import React, { useState } from 'react';
import Panier from './components/Panier';
import Stepbarre from './components/StepBarre';


const Panierprocess = (props) => {
    const btnPanier = (
        <div className="w-100 d-flex align-items-center justify-content-center">
            <button className="produitBuyBtn">Valider mon panier</button>
        </div>
    )
    const [panierStep,setPanierStep] = useState(<Panier/>)
    const [stepBarreBtn,setStepBarreBtn] = useState(btnPanier)
    return (
        <>    
          <Stepbarre button={stepBarreBtn}/>
          {panierStep}
        </>
    );
}

export default Panierprocess;
